import React from 'react'

const Links = () => {
  const usefulLinks = [
    {
      title: "AFAD",
      description: "Afet ve Acil Durum Yönetimi Başkanlığı",
      url: "https://www.afad.gov.tr/"
    },
    {
      title: "Kandilli Rasathanesi",
      description: "Boğaziçi Üniversitesi Kandilli Rasathanesi ve Deprem Araştırma Enstitüsü",
      url: "http://www.koeri.boun.edu.tr/"
    },
    {
      title: "MTA",
      description: "Maden Tetkik ve Arama Genel Müdürlüğü",
      url: "https://www.mta.gov.tr/"
    },
    {
      title: "USGS",
      description: "United States Geological Survey - Global Deprem Verileri",
      url: "https://earthquake.usgs.gov/"
    }
  ];

  return (
    <div className="min-h-screen bg-[#303030] text-white p-8">
      <div className="max-w-4xl mx-auto">
        <h1 className="text-4xl font-bold mb-8 text-center">Relevant links</h1>
        
        <div className="grid gap-6">
          {usefulLinks.map((link, index) => (
            <a
              key={index}
              href={link.url}
              target="_blank"
              rel="noopener noreferrer"
              className="block p-6 bg-[#202020] rounded-lg hover:bg-[#404040] transition-colors duration-300"
            >
              <h2 className="text-2xl font-semibold mb-2">{link.title}</h2>
              <p className="text-gray-300">{link.description}</p>
            </a>
          ))}
        </div>
      </div>
    </div>
  )
}

export default Links
